import React from "react";
import { useSelector } from "react-redux";
import Typography from "@mui/material/Typography";
import { Grid } from "@mui/material";
import AppWidgetSummary from "./components/sections/appwidgetsummary";
import AppWebsiteVisits from "./components/sections/app_website_visits";
import AppCurrentVisits from "./components/sections/app_current_visits";

const Overview = () => {
  const { myData } = useSelector((state) => state.user);

  return (
    <div style={{ height: "75vh" }}>
      <Typography variant="h6" gutterBottom>
        Hi, {myData?.firstname}
      </Typography>
      <Grid container spacing={3}>
        <Grid item xs={12} sm={6} md={3}>
          <AppWidgetSummary
            title="Google Chrome Visits"
            total={714000}
            icon={"ant-design:chrome-filled"}
          />
        </Grid>

        <Grid item xs={12} sm={6} md={3}>
          <AppWidgetSummary
            title="Mozilla Firefox Visits"
            total={13528}
            color="info"
            icon={"ant-design:fire-filled"}
          />
        </Grid>

        <Grid item xs={12} sm={6} md={3}>
          <AppWidgetSummary
            title="Apple Safari Visits"
            total={1723}
            color="warning"
            icon={"ant-design:apple-filled"}
          />
        </Grid>

        <Grid item xs={12} sm={6} md={3}>
          <AppWidgetSummary
            title="Windows Edge Visits"
            total={234471}
            color="error"
            icon={"ant-design:windows-filled"}
          />
        </Grid>

        <Grid item xs={12} md={6} lg={8}>
          <AppWebsiteVisits
            title="Website Visits"
            subheader="(+43%) than last year"
            chartLabels={[
              "01/01/2003",
              "02/01/2003",
              "03/01/2003",
              "04/01/2003",
              "05/01/2003",
              "06/01/2003",
              "07/01/2003",
              "08/01/2003",
              "09/01/2003",
              "10/01/2003",
              "11/01/2003",
            ]}
            chartData={[
              {
                name: "Team A",
                type: "column",
                fill: "solid",
                data: [23, 11, 22, 27, 13, 22, 37, 21, 44, 22, 30],
              },
              {
                name: "Team B",
                type: "area",
                fill: "gradient",
                data: [44, 55, 41, 67, 22, 43, 21, 41, 56, 27, 43],
              },
              {
                name: "Team C",
                type: "line",
                fill: "solid",
                data: [30, 25, 36, 30, 45, 35, 64, 52, 59, 36, 39],
              },
            ]}
          />
        </Grid>

        <Grid item xs={12} md={6} lg={4}>
          <AppCurrentVisits
            title="Current Visits"
            chartData={[
              { label: "Obio Akpor", value: 4344 },
              { label: "Ahoada East", value: 5435 },
              { label: "Gokana", value: 1443 },
              { label: "Port Harcourt", value: 4443 },
            ]}
            chartColors={["#18113C", "blue", "violet", "yellow"]}
          />
        </Grid>
      </Grid>
    </div>
  );
};

export default Overview;
